        .el-upload {
            display: inline-block;
            text-align: center;
            cursor: pointer;
            outline: 0
        }

        .el-upload__input {
            display: none
        }

        .el-upload__tip {
            font-size: 12px;
            color: #606266;
            margin-top: 7px
        }

        .el-upload iframe {
            position: absolute;
            z-index: -1;
            top: 0;
            left: 0;
            filter: alpha(opacity=0)
        }

        .el-upload--picture-card {
            background-color: #fbfdff;
            border: 1px dashed #c0ccda;
            border-radius: 6px;
            box-sizing: border-box;
            width: 148px;
            height: 148px;
            cursor: pointer;
            line-height: 146px;
            vertical-align: top
        }

        .el-upload--picture-card i {
            font-size: 28px;
            color: #8c939d
        }

        .el-upload--picture-card:hover,
        .el-upload:focus {
            border-color: #409eff;
            color: #409eff
        }

        .el-upload:focus .el-upload-dragger {
            border-color: #409eff
        }

        .el-upload-dragger {
            background-color: #fff;
            border: 1px dashed #d9d9d9;
            border-radius: 6px;
            box-sizing: border-box;
            width: 360px;
            height: 180px;
            text-align: center;
            cursor: pointer;
            overflow: hidden
        }

        .el-upload-dragger .el-icon-upload {
