                                        This email is already in the UNGM system.
                                        <a href="/Account/Account/ForgotPassword">Have you forgotten your
                                            password?</a></span>
                                    <span id="emailIsForOrganizations">
                                        <br>
                                        This email domain is reserved for Staff Members.
                                        <a href="/Account/Registration/OrganizationUser">If you are a Staff Member,
                                            return and click on the Organizations members box.</a></span>
                                    <span id="emailIsNotForOrganizations">
                                        The email is not available in your organization.
                                        <a href="/Account/Registration">Register as a supplier.</a>
                                    </span>
                                    <span class="checkingAvailability">
                                        <span class="smallThrobber"></span>Checking availability.
                                    </span>

                                    <script>
                                        if (!window.UNGM.EmailValidation) {
                                            window.UNGM.EmailValidation = {
                                                verified: false,
                                                isAvailable: false,
                                                isOrganizationEmail: false,
                                                verificationUrl: null,
                                                init: function () {
                                                    UNGM.EmailValidation.verified = false,
                                                        UNGM.EmailValidation.isAvailable = "True" === "True",
                                                        UNGM.EmailValidation.isOrganizationEmail = "False" ===
                                                        "True",

                                                        $("input[name='Email']").on("focusout", UNGM
                                                            .EmailValidation.verifyEmailAvailability);
                                                    $("input[name='Email']").on("focusin", UNGM.EmailValidation
                                                        .emailFocusIn);
                                                    $("#AgencyId").off("change").on("change", UNGM
                                                        .EmailValidation.verifyEmailAvailability);
                                                    UNGM.EmailValidation.verificationUrl = UNGM.EmailValidation
                                                        .isOrganizationEmail ?
                                                        "UNUser/Account/IsUsernameAvailableAndIsUN" :
                                                        "Account/Account/IsEmailAvailableForVendorAndInstitutionalOrganization";
                                                },
                                                verifyEmailAvailability: function (async = true) {
                                                    var emailInputElement = $("input[name='Email']");

                                                    if (emailInputElement.length == 0 || !emailInputElement
                                                        .val().length || !emailInputElement.valid()) {
                                                        return;
                                                    }
                                                    if (emailInputElement.length > 1) {
                                                        emailInputElement = emailInputElement.last();
                                                    }

                                                    $(".checkingAvailability").show();
                                                    var email = emailInputElement.val();
                                                    var agencyId = $("#AgencyId").val();

                                                    $.ajax({
                                                        url: UNGM.siteRoot + UNGM.EmailValidation
                                                            .verificationUrl + '?email=' +
                                                            encodeURIComponent(email) + '&userId=' +
                                                            '&agencyId=' + agencyId,
                                                        type: 'GET',
                                                        async: async,
                                                        contentType: 'application/json',
                                                        success: function (response) {
                                                            $(".checkingAvailability").hide();
                                                            if (response.isOrganizationDomain !==
                                                                UNGM.EmailValidation
                                                                .isOrganizationEmail) {
                                                                UNGM.EmailValidation.verified =
                                                                    false;
                                                                UNGM.Validation.markElementInvalid(
                                                                    emailInputElement);
                                                                if (UNGM.EmailValidation
                                                                    .isOrganizationEmail) {
                                                                    $("#emailIsNotForOrganizations")
                                                                        .show();
                                                                } else {
                                                                    $("#emailIsForOrganizations")
                                                                        .show();
                                                                }
                                                            } else if (response.isAvailable !== UNGM
                                                                .EmailValidation.isAvailable) {
                                                                UNGM.EmailValidation.verified =
                                                                    false;
                                                                UNGM.Validation.markElementInvalid(
                                                                    emailInputElement);
                                                                $("#emailExists").show();
                                                            } else {
                                                                UNGM.EmailValidation.verified =
                                                                true;
                                                                UNGM.Validation.markElementValid(
                                                                    emailInputElement);
                                                                $("#emailExists, #emailIsForOrganizations, #emailIsNotForOrganizations")
                                                                    .hide();
                                                                UNGM.Validation.validateElement(
                                                                    emailInputElement);
                                                            }
                                                        }
                                                    });
                                                },
                                                emailFocusIn: function () {
                                                    UNGM.EmailValidation.verified = false;
                                                    $(".checkingAvailability, #emailExists, #emailIsForOrganizations, #emailIsNotForOrganizations")
                                                        .hide();
                                                }
                                            }
                                        };

                                        $(document).ready(function () {
                                            UNGM.EmailValidation.init();
                                        });

                                    </script>

